import {Component} from 'react'
import logo from './logo.svg';
import './App.css';

class App extends Component {

  constructor(){
    super();
    this.state = {
      monsters: [
      {name: 'Linda'}, 
      {name: 'Frank'}, 
      {name: 'Jacky'}
    ]
    }
  }

  render(){
    return <div class='App'>
      {this.state.monsters.map((monster) => {
        <h1>{monster.name}</h1>
      })}
    </div>

  }

}

export default App;
